import { Axios } from './Axios';
import jwt_decode from 'jwt-decode';

const handleGetAllHouses =()=>{
    return new Promise((resolve, reject)=>{
        Axios.get('https://www.anapioficeandfire.com/api/houses/')
            .then(house =>{
                resolve(house)
            })
            .catch((error)=>{
                reject(error)
            })
    })
}

export {
    handleGetAllHouses
}
